Mit 3,7-5,0 mm eine mittelgrosse Art (Abb. 11) der Untergattung. Oberseite dunkel rotbraun, Nahtintervall, Mitte der Halsschildbasis und ein ± ausgedehnter Bereich vor dessen Vorderrand mitunter rötlich aufgehellt. Selten treten Exemplare mit schwarzbrauner Färbung der Oberseite (wie bei 

B. csikii

) auf. Unterseite bis auf das schwarzbraune Abdomen, rotbraun. Kopf im Verhältnis zum Halsschild von mittlerer Grösse (KB/HB 0,73- 0,81). Augen stark halbkugelig gewölbt. Halsschild (
Abb. 43-45
) 1,27-1,40 breiter als lang und 1,24-1,37 breiter als der Kopf. Seiten zu den Vorderwinkeln konvex gerundet verengt, zu den Hinterwinkeln gerade oder schwach gerundet verengt. Apikalrand gerade oder schwach konvex, Vorderwinkel nicht oder selten sehr schwach vorstehend. Basis in der Mitte konvex, an den Seiten schräg vorgezogen. Hinterecken breit abgerundet, mitunter ein sehr stumpfer Winkel angedeutet. Seitenrand relativ breit und deutlich ausgebildet, bis zur Mitte der Basalgruben fortgesetzt. Basalgruben von mittlerer Grösse, meist deutlich grubig vertieft und mit grober Punktur, die sich mitunter ± weit über die Eindrücke hinaus ausdehnt. Medianlinie deutlich eingeschnitten, in der basalen, seltener auch in der apikalen Hälfte punktiert. Flügeldecken nach hinten schwach erweitert oder ± parallel, 1,48-1,64 länger als breit, 1,40-1,56 breiter und 2,86-3,23 länger als der Halsschild. Skutellarstreifen lang ausgebildet, selten einseitig verkürzt. Streifen (insbesondere die äusseren) mitunter im Grunde schwach und fein punktiert. Porenpunkt in der apikalen Hälfte des 3. Intervalls vorhanden. Flügel dimorph, meist makropter, seltener brachypter. Metepisternen lang, an der Innennaht etwa 1,5-1,6 länger als an der Basis breit. 6. Sternit in beiden Geschlechtern mit 4 längeren Seten am Apikalrand. Medianlobus des Aedoeagus mit charakteristischer Form (
Abb. 85-87
) und spezifischen Feinstrukturen der Internalsacks.
